/* eslint-disable no-unused-vars */
import React from 'react';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';

export default function Main() {
  return (
    <div className="container-fluid ">
      <h1 className="display-4 fw-bold">Hello, this is SleepyApp</h1>
      <p className="col-md-7 fs-4">
        We are here to help mothers to sleep more. Is it possible? Yes, you just
        need to know how to organize sleep of your baby.
      </p>
      <p className="col-md-7 fs-4">Btw, you're the best mom.</p>
      <p>
        <Button
          variant="primary"
          style={{
            backgroundColor: ' rgb(60,125,128)',
            borderColor: 'rgb(60,125,128)',
          }}
        >
          I want to sleep more!
        </Button>
      </p>
    </div>
  );
}
